const About = () => (
  <Layout>
    <article id="portfolio-container">
      <section>
        <img src="/sa.png" alt="myPhoto" />
      </section>
    </article>
    <style jsx>{`
      img {
        position:relative;
        top:100px;
        left:100px;
        border-radius:20%;
        width:25%;
      }
    `}</style>
  </Layout>
);

export default About;
